import React, {useState} from "react";
import {IconButton, Tooltip} from "@material-ui/core";
import EditIcon from "@material-ui/icons/Edit";
import NewQuestionContextProvider from "../../contexts/NewQuestionContext";
import EditDialog from "../BetaEditDialog";
import EditDialog2 from "../BetaEditDialog2";

const EditQuestionButton = ({ question, index }) => {
  const [open, setOpen] = useState(false);

  return (
    <>
      <Tooltip title="edit">
        <IconButton onClick={() => setOpen(true)}>
          <EditIcon />
        </IconButton>
      </Tooltip>
      <NewQuestionContextProvider>
        {/* <EditDialog question={question} open={open} setOpen={setOpen} /> */}
        <EditDialog2 index={index} question={question} open={open} setOpen={setOpen} />
      </NewQuestionContextProvider>
    </>
  );
};

export default EditQuestionButton;
